[{"location":"","page":"Home","title":"Home","text":"CurrentModule = ContinuumMechanicsBase","category":"page"},{"location":"#ContinuumMechanicsBase","page":"Home","title":"ContinuumMechanicsBase","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"ContinuumMechanicsBase contains the core functionality for continuum mechanics methods. The methods are intended to be overloaded by the package implementing the common interface. The objective of the package is to provide a common interface between interacting continuum modelling packages. The package is currently used by TRACER Lab for multi-scale modelling of soft materials. Packages which rely on ContinuumMechanicsBase include:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Hyperelastics.jl","category":"page"},{"location":"","page":"Home","title":"Home","text":"Further packages are in development and will be made public upon completion. Please submit a PR if you are using this package in your project. ","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [ContinuumMechanicsBase]","category":"page"},{"location":"#ContinuumMechanicsBase.MaterialHistory","page":"Home","title":"ContinuumMechanicsBase.MaterialHistory","text":"MaterialHistory(values::Vector, times::Vector)\n\nStructure for storing the behavior of a material as it evolves in time. Design to be used in time-dependent models such as viscoelasticity.\n\n\n\n\n\n","category":"type"},{"location":"#ContinuumMechanicsBase.predict-Tuple{ContinuumMechanicsBase.AbstractMaterialModel, ContinuumMechanicsBase.AbstractMaterialTest, Any}","page":"Home","title":"ContinuumMechanicsBase.predict","text":"predict(ψ::AbstractMaterialModel, test::AbstractMaterialTest, ps)\n\nFields:\n\nψ: Material Model\ntest or tests: A single test or vector of tests. This is used to predict the response of the model in comparison to the experimental data provided.\nps: Model parameters to be used.\n\n\n\n\n\n","category":"method"},{"location":"","page":"Home","title":"Home","text":"","category":"page"}]
